import {useState} from 'react'
import MyMoves from './components/MyMoves'

function App() {
  const [handleSelect, setHandleSelect] = useState(null)

  const handleClicked = click => {
    setHandleSelect(click)
  }

  return (
    <div className="silder-container">
      <div className="silder-component">
        <button
          className="button"
          type="button"
          onClick={() => handleClicked('clickOne')}
        >
          My Moves
        </button>
      </div>
      <div className="App">{handleSelect === 'clickOne' && <MyMovesOne />}</div>
    </div>
  )
}

function MyMovesOne() {
  return (
    <div className="container-div-half">
      <div>
        <MyMoves />
      </div>
    </div>
  )
}
export default App
